        "alias": "hip-hop-16b518dc38a",
        "description": "Description (basics): Class will start with a warm up and conditioning period. After that it will roll right into choreography. My choreography will change every week. If there are repeat students I will probably have them do the dance from the previous week once just for fun, but nothing new will be added on or time spent cleaning it. My warm up tends to be similar from week to week, different music but same basics. The type of music in my class is usually songs heard recently on the radio, as a characteristic of Hip Hop is to be current. A lot of my music selection is based on my mood so there is often variety make an appearance. Music will be played through the entire warm up and most of the class, except when Im giving choreography. Style: My style is a mixture of East and West Coast Hip-Hop, having intricacies centered around grooves and swag. The jazz funk aspect of my choreography comes from pop-hop inspiration and is what is seen in music videos. This class is designed to be fun and welcoming, no judgments nor criticisms. Dance has been presented to me as a way to spread positivity, creativity, and inspiration and I intend to continue passing it along as such. I look forward to seeing you in class.",
