        "description": "Students in Kendra’s classes often find themselves focusing on the journey between asanas as they move through sun salutations and standing poses, being reminded to smile and breathe. Then a long stretch, a twist, heart opening, and inversions bring them into a sweet and well deserved savasana, often incorporating a guided relaxation. She aims to keep it simple, yet finds the challenge within that simplicity. Her classes are always strong, though the strength we use may be found through deep relaxation one day, a good vigorous flow the next, depending on the needs of the students in the room. In any given class we may chant, we will probably laugh, we may sigh, we may sit in silence, but we will always observe and honor what we find.",
